import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import Home from './Home/Home';
import Navbar from './Navbar/Navbar';

function App() {
  return (
    <div className="App">
      <Router>
          <Navbar />
          <Switch>
              <Route exact path="/">
                <Home />
              </Route>
          </Switch>

      </Router>
    </div>
  );
}

export default App;
